import styled from 'styled-components'


export const FullContainer=styled.div`
width: 100%;
height: 50px;
background: #7AC751;
`
export const Conatainer=styled.div`
width: 847px;
display: flex;
align-items: center;
flex
`
export const Title=styled.div`
font-family: Rubik;
font-style: normal;
font-weight: normal;
font-size: 16px;
line-height: 19px;
color: #FFFFFF;
`
